import "./styles.css";

function GlassmorphismBox() {
	return (
		<div className="glassmorphism-box">
			<p>Transform Your cooking experience with AI-Driven Meal Planning!</p>
			<div className="glassmorphism-box">
				<p>Take a Quick Survey & Get an Instant Recipe!</p>
				<button className="red-button">Get Your Recipe!</button>
			</div>
		</div>
	);
}

export default GlassmorphismBox;
